import styled from "styled-components"

export const TripsCard = styled.div `

box-shadow: rgb(0 0 0 / 30%) 0px 4px 8px 0px;
padding: 10px 20px;
border-radius: 20px;
margin: 10px 0px;
width: 300px;
flex-direction: row;
float: inline-end;


* {
  box-sizing: border-box;
}


/* Float four columns side by side */
.column {
  float: left;
  width: 25%;
  padding: 0 10px;
}








`
